import logo from "./logo.svg";
import "./App.css";
import Header from "./components/header";
import Footer from "./components/footer";

import ContainerItems from "./components/containeritems"
import Nchamp from "./components/Nchamp";
import Nclass from "./components/Nclass";
import Nitems from "./components/Nitems";
import Nrunas from "./components/Nrunas";
import FindChamp from "./components/findChamp";


import React, { useState } from "react";
import Onechamp from "./components/onechamp";

function App() {
  const [exec, setExec] = useState('Yasuo');
  const [exec2, setExec2] = useState('');
  const [exec3, setExec3] = useState('');



  const ListChamp = () =>{
      setExec('')
      setExec2('')
  }

  const ListItem = () =>{
    setExec2('item')
    setExec('d')
  }



  const namechamp = () =>{
    setExec2('nchamp')
    setExec('d')

  }


  const nameitems = () =>{
    setExec2('nitems')
    setExec('d')

  }


  const nameclass = () =>{
    setExec2('nclass')
    setExec('d')

  }


  const namerunas = () =>{
    setExec2('nrunas')
    setExec('d')

  }
  console.log(exec)
  return (
    <div className="App">
      <Header />

          {
            exec === '' && <FindChamp trocaExec={setExec} rota={exec}/>
          }
          {
            exec !== '' && exec2 === '' && <Onechamp nomeChamp={exec}/>
          }
          {
            exec2 === 'item' && <ContainerItems />
          }
          {
            exec2 === 'nchamp' && <Nchamp/>
          }
          {
            exec2 === 'nitems' && <Nitems/>
          }
          {
            exec2 === 'nclass' && <Nclass/>
          }
          {
            exec2 === 'nrunas' && <Nrunas/>
          }

      <Footer />
    </div>
  );
}

export default App;
